define('utils/conditional-load',[
    'jquery',
], function ($) {
    // Load data from Aptivate.data if it exists or server otherwise
    function conditionalLoadData(collection, data_field, fetch_options) {
        var promise;

        if (Aptivate.data[data_field]) {
            collection.reset(Aptivate.data[data_field]);
            delete Aptivate.data[data_field];

            // Return resolved promise
            promise = $.Deferred();
            promise = promise.resolve();
        } else {
            promise = collection.fetch(fetch_options);
        }
        return promise;
    }
    return conditionalLoadData;
});

define('pages/overview-page',[
        'jquery',
        'models/models',
        'models/collections',
        'views/overview/container',
        'utils/conditional-load',
], function ($, models, collections, OverviewContainer, load) {

    function OverviewPage(options) {

        this.load = function (showView) {
            // Load missing data
            var self = this,
                promises = [
                    load(Aptivate.logframe.results, "results"),
                    load(Aptivate.logframe.activities, "activities"),
                    load(Aptivate.logframe.budgetlines, "budgetlines"),
                    load(Aptivate.logframe.talines, "talines"),
                    load(Aptivate.logframe.statusupdates, "statusupdates")
                ];

            $.when.apply(this, promises).then(function () {
                self.overviewContainer = new OverviewContainer({
                    model: options.logframe
                });
                showView(self.overviewContainer);
            });
        };

        this.unload = function () {
            // Possible race condition here if remove() is called before the
            // promises above have completed, overviewcontainer won't yet exist.
            this.overviewContainer.remove();
        };
    }

    return OverviewPage;
});

define('views/static-list',[
    'underscore',
    'backbone'
], function (_, Backbone) {
    var StaticListView = Backbone.View.extend({
        tagName: 'ul',

        initialize: function (options) {
            // Expected options:
            // 'collection' -- a collecttion of the list item models
            // 'itemView' -- a view to use to render the items
            _.extend(this, _.pick(options, 'itemView', 'collection'));

            this.listenTo(this.collection, 'add', this.addItem);
            this.listenTo(this.collection, 'reset', this.render);
        },

        addItem: function (item) {
            // TODO: re-use existing sub-views if possible?
            var view = new this.itemView({ model: item });
            this.$el.append(view.render().el);
        },

        addAll: function () {
            this.collection.each(this.addItem, this);
        },

        render: function () {
            this.$el.html('');
            this.addAll();
            return this;
        },

    });
    return StaticListView;
});

define('views/indicator/target-row',[
    'backbone',
    'views/static-list',
    'views/input_view',
], function (Backbone, StaticListView, Editable) {

    // View for a target-data row in the milestone table, comprising a
    // subindicator in the first column and then the targets belonging to the
    // owning indicator; associated wiht the subindicator, and arranged in
    // columns according to the given collection of milestones, which are taken
    // to be in order.
    var TargetRowView = StaticListView.extend({
        tagName: "tr",

        itemView: Editable.extend({
            tagName: "td",
            template_selector: "#target-value-cell",
        }),

        // Expected options:
        // 'indicator' -- Indicator model 
        // 'collection' -- Target value models (belonging to the indicator)
        // 'collumns' -- the milestone values that define table columns
        // 'model' -- subindictor
        initialize: function (options) {
            _.extend(this,
                _.pick(options,
                    'collection',
                    'collumns',
                    'indicator',
                    'model')
            );
            this.subindicator = this.model || new Backbone.Model(),

            this.listenTo(this.collection, 'reset', this.render);
            this.listenTo(this.indicator, 'sync', this.render);
            this.listenTo(this.subindicator, 'sync', this.render);
        },

        subIndicatorView: Editable.extend({
            tagName: 'th',
            className: 'fixed-column',
            template_selector: "#editable-name",
        }),

        // Add views for target measurements for the given:  
        //  - indicator, 
        //  - milestone (column), and
        //  - subindicator (row)
        addAll: function () {
            this.collumns.each(function (milestone) {
                var opts = {
                        milestone: milestone.id,
                        indicator: this.indicator.get('id'),
                        subindicator: this.subindicator.get('id'),
                    },
                    target = this.collection.findWhere(opts) ||
                             this.collection.add(opts);
                this.addItem(target);
            }, this);
        },

        render: function () {
            if (!this.indicator.isNew()){
                this.$el.html('');
                new this.subIndicatorView({
                    model: this.subindicator
                }).render().$el.appendTo(this.$el);
                if (!this.subindicator.isNew()) {
                    this.addAll();
                }
            }
            return this;
        },

    });

    return TargetRowView;
    
});

define('views/indicator/milestone-table',[
    'views/base_view',
    'views/generic/list',
    'views/generic/template-list',
    'views/input_view',
    'views/indicator/target-row',
], function (BaseView, ListView, StaticListView, Editable, TargetRowView) {

    var MilestoneTableView = BaseView.extend({

        tagName: 'table',
        template_selector: "#milestone-table",
        className: 'scrollable',

        initialize: function () {
            Backbone.Subviews.add(this);
        },

        subviewCreators: {
            milestoneRow: function () {
                return new StaticListView({
                    collection: Aptivate.logframe.milestones,
                    tagName: 'tr',
                    template_selector: "#milestone-table-heading-row",
                    attributes: { class: 'milestone-heading-row' },
                    itemView: Editable.extend({
                        tagName: "th",
                        template_selector: "#milestone-table-heading",
                    }),
                });
            },
            subindicatorRows: function () {
                var indicator = this.model;

                if (!indicator.targets) {
                    // TODO: move the targets into the Indicator declaration
                    indicator.targets = Aptivate.logframe.targets.subcollection({
                        filter: function (target) {
                            var sub_id = target.get("subindicator");
                            return !!(indicator.subindicators.get(sub_id));
                        }
                    });
                }
                // Next line is required because next-to-be-added indicator does
                // not have an ID yet so its related subcollections need to be
                // recreated correctly once it does (once it has been added)
                indicator.on("change:id", indicator.initialize);

                return new ListView({
                    itemView: TargetRowView.extend({
                        indicator: indicator,
                        collection: indicator.targets,
                        collumns: Aptivate.logframe.milestones,
                    }),
                    collection: indicator.subindicators,
                    newModelOptions: function () {
                        // defer looking for the owning indicator's id because
                        // it might have been new when this view was created.
                        return { indicator: indicator.get('id') };
                    },
                    tagName: 'tbody',
                });
            },
        },

    });

    return MilestoneTableView;
});


