define('pages/result-page',[
    'jquery',
    'views/result/container',
    'utils/conditional-load',
], function ($, ResultContainer, load) {

    function ResultPage(options) {

        this.load = function (showView) {
            var self = this,
                fetchForResult,
                logframe = Aptivate.logframe,
                promise = load(logframe.results, 'results'); // TODO: load only the result for this page

            promise.then(function () {
                var promises,
                    result = logframe.results.findWhere({
                        id: options.resultId
                    });
                if (result) {
                    fetchForResult = {
                        reset: true,
                        traditional: true,
                        data: { result: result.get("id") }
                    };
                    promises = [
                        load(logframe.milestones, "milestones", { reset: true }),
                        load(logframe.targets, "targets", fetchForResult),
                        load(logframe.subindicators, "subindicators", fetchForResult),
                        load(logframe.indicators, "indicators", fetchForResult),
                        load(logframe.assumptions, "assumptions", fetchForResult)
                    ];

                    $.when.apply(this, promises).then(function () {
                        self.resultContainerView = new ResultContainer({ // TODO: remove subviews on page change
                            model: result,
                        });
                        showView(self.resultContainerView);
                    });
                }
            });
        };

        this.unload = function () {
            // Possible race condition here if remove() is called before the
            // promises above have completed, resultContainerView won't yet exist.
            this.resultContainerView.remove();
        };

    }

    return ResultPage;
});

define('views/monitor/header-row',[
    'views/generic/list',
], function (ListView) {
    var MonitorHeaderRowView = ListView.extend({
        tagName: 'tr',
        template_selector: '#monitor-header-row',
        unknownName: '(undefined)',

        // Think of this as a public static method; data-entry-row uses it too.
        firstMilestone: function(milestones){
            return milestones.first();
        },

        // Think of this as a public static method; data-entry-row uses it too.
        nextMilestone: function(milestones){
            return milestones.filter(function (milestone) {
                return new Date(milestone.get('date')).getTime() >= Date.now();
            })[0];
        },
        
        // Return the name of the first milestone (baseline) 
        // or undefined if not available
        getMilestoneName: function (selectMilestone) {
            var milestone = selectMilestone(Aptivate.logframe.milestones);
            return milestone ? milestone.get('name') : this.unknownName;
        },

        listItems: function () {
            return this.collection.slice(-3); // TODO: use settings
        },

        
        getTemplateData: function () {
            var data = ListView.prototype.getTemplateData.apply(this, arguments);
            data.baseline = this.getMilestoneName(this.firstMilestone);
            data.milestone = this.getMilestoneName(this.nextMilestone);
            return data;
        },
    });

    return MonitorHeaderRowView;
});

